const Test = () => {
  const [inputs, setInputs] = useState({
    email: "",
    password: "",
  });

  const handleGoogleClick = () => {
    const url = "http://localhost:3000";
    window.open(
      "http://localhost:3000",
      "login",
      "popup,width=500px,height=600px,resizable=false,left=700px,top=250px"
    );
    window.replace = "/";
  };

  return (
    <div>
      <button onClick={handleGoogleClick}>google</button>
    </div>
  );
};

export default Test;
